function build_url(url, utm){
  if(utm == null){
    return url.indexOf('?') != -1 ? url + '&' : url + '?';
  }
  else {
    return url.indexOf('?') != -1 ? url + '&' + utm + '&' : url + '?' + utm + '&';
  }
}

function getelementfromlineitem(campid, element) {
  if (lineItemsMapping[campid]==undefined) {
    return lineItemsMapping[0][element];
  }
  else {
    return lineItemsMapping[campid][element];
  }
}
  
function getproductinshop(wid,product_list) {
  var shop_catalog_version = shops[wid].shopDetails.catalog_version;
  var productinshop=[];

  for (i = 0; i< product_list.length; i++){
    // put catalog versions in a list
    var product_catalog_versions = product_list[i]["data"]["catalog_version"];
    for(var j=0;j<product_catalog_versions.length;j++){
      if (product_catalog_versions[j]==shop_catalog_version) {
        productinshop.push(product_list[i]);
      }
    }
  }
  console.log('Nb of products in shop : ' + productinshop.length);
  return productinshop;
}
