function getproductwithinvaliditydates(product_list) {
  var prodvalid=[];
  var today = new Date();
  console.log("Today : " + new Date());
  
  for (i = 0; i< product_list.length; i++){
    if(product_list[i]["data"]["end_date"]){
      if (new Date(product_list[i]["data"]["end_date"])>today || new Date(operation.operationDetails.ad_info.end_date_promotion) < today) {
        prodvalid.push(product_list[i]);
      }
    }else{
      prodvalid.push(product_list[i]);
    }
  }
  console.log('Nb of products within validity dates : ' + prodvalid.length)
  return prodvalid;
}

