function getproductinstock(wid,product_list,stocklist) {
  var prodenstock=[];

  for (i = 0; i< product_list.length; i++){
    var pid = product_list[i]["id"];
    if (stocklist[wid] != undefined && stocklist[wid][pid]>0) {
      prodenstock.push(product_list[i]);
    }else if (stocklist[wid] === undefined){
      prodenstock.push(product_list[i]);
    }
  }
  console.log('Nb of products in stock : ' + prodenstock.length)
  return prodenstock;
}

