function drawnproducts(wid,n) {

  var prodinshop=[];
  var prodinstock=[];

  //check if there are 'vitesses' for this campaign
  if (shops[wid]["shopDetails"]["catalog_version"]==''){
    prodinshop=products;
  }
  else {
    var prodinshop=getproductinshop(wid,products);
  }

  //check if there are stocks for this campaign
  if (typeof stocklist === 'undefined'){
    prodinstock=prodinshop;
  }
  else{
    var prodinstock=getproductinstock(wid,prodinshop,stocklist)
  }

  //check if the validity dates of the offer for the product have not expired
  product_availables=getproductwithinvaliditydates(prodinstock);

  var foundlist = [];
  var pnum;
  var products_copy = product_availables.slice();
  var found = 0;
  var count = 0;

  while (found < n) {

    //only for multiproducts banners
    if (n==2 && found==1){
      
      //check if the first product has some friends in his categ
      products_in_categ = []
      for (i=0; i<products_copy.length; i++){
        if (products_copy[i]["data"]["category_name_url_1"] == foundlist[0]["data"]["category_name_url_1"]){
          
          products_in_categ.push(products_copy[i]);
          count++;       

        }
      }
      console.log("Number of products in same category : " + count)

      if (count!=0){
        pnum = products_in_categ.length;
        var ran = Math.random();
        var slice = 1/pnum;
        var idx = Math.floor(ran/slice);
        foundlist.push(products_in_categ[idx]);
        return foundlist;
      }
    }

    //normal case
    pnum = products_copy.length;
    if (pnum != 0 ){
      var ran = Math.random();
      var slice = 1/pnum;
      var idx = Math.floor(ran/slice);
      foundlist.push(products_copy[idx]);
      products_copy.splice(idx, 1);
    }else {
      foundlist.push(foundlist[0]);
    }
    found++;
  }
  return foundlist;
}
  
