//HandleBar Helper
Handlebars.registerHelper("inc", function(value, options){
  return parseInt(value) + 1;
});

Handlebars.registerHelper("formatDate", function(value, options){
  try{
    date_list= value.split("-");
    return date_list[2]+"/"+date_list[1]+"/"+date_list[0].slice(-2);
  }
  catch(error){
    return "";
  }
});

Handlebars.registerHelper("eq", function(arg1, arg2, options){
  if (arg1 == "" || arg2 == "" || arg1 == undefined || arg2 == undefined){
    return options.inverse(this);
  }
  else {
    return (arg1 == arg2) ? options.fn(this) : options.inverse(this);
  }
});

Handlebars.registerHelper("neq", function(arg1, arg2, options){
  if (arg1 == "" || arg2 == "" || arg1 == undefined || arg2 == undefined){
    return options.inverse(this);
  }
  else {
    return (arg1 != arg2) ? options.fn(this) : options.inverse(this);
  }
});

Handlebars.registerHelper('or', function (arg1, arg2, options) {
  if ((arg1 == "" || arg1 == undefined) && (arg2 =="" || arg2 == undefined)) {
      return options.inverse(this);
  }
  else {
      return options.fn(this);
  }
});

Handlebars.registerHelper("formatCurrency", function(arg1, options){
  if (typeof arg1 == "number"){
    return Number.isInteger(arg1) ? (arg1.toString() + "€") : (arg1.toFixed(2).replace('.', ',') + "€");
  }
  else if (typeof arg1 == "string"){
    return parseInt(arg1) == arg1 ? (arg1 + "€") : (parseFloat(arg1).toFixed(2).replace('.', ',') + "€");
  }
  else{
    return "";
  }
});
